import {Link} from "react-router-dom";

function Labs() {
    return(
       <div>
          <Link to="/labs/a3">A3</Link> |
          <Link to="/hello">Hello</Link> |
          <Link to="/tuiter">Tuiter</Link>
          <h1>Assignment 3</h1>
       </div>
    );
 }
 export default Labs;
